import React from "react";
import PropTypes from "prop-types";
import withStyles from "@material-ui/core/styles/withStyles";
import Typography from "../Typography";
import Tag from "../Tag";
import Box from "../Box";
import { styles } from "./styles";

const Outlet = ({ classes, onClick, isMobile }) => {
    return (
        <Box
            onClick={onClick}
            className={`${classes.root} ${onClick ? classes.pointer : ""}`}
        >
            <Tag label="Trip até R$500" color="spot" />
            <Typography
                type={isMobile ? "headline6" : "headline2"}
                className={classes.title}
            >
        Programe sua trip com nossa{" "}
                <span className={classes.breaktitle}>
          seleção de pacotes até R$500!
                </span>
            </Typography>
            <Typography type="body2regular">
        Separamos os melhores destinos para você curtir praia, cultura, diversão
        ou maravilhas da natureza na sua viagem. É só clicar!
            </Typography>
        </Box>
    );
};

Outlet.propTypes = {
    classes: PropTypes.object.isRequired,
    onClick: PropTypes.func,
    isMobile: PropTypes.bool,
};

export default withStyles(styles, { withTheme: true })(Outlet);
